  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100062 includes chemical,
  physical, time series and underway - surface data collected from MOORINGS in the
  North Pacific Ocean and South Pacific Ocean from 2009-10-09 to 2010-04-19. These
  data include CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE (pCO2), CARBON
  DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, OXYGEN - PERCENT SATURATION, SALINITY and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
  dioxide (CO2) gas analyzer and Carbon dioxide (CO2) laminar flow bubble equilibrator
  (for buoy measurement).nnThese data were collected by Christopher Sabine and Adrienne
  Sutton of US DOC; NOAA; OFFICE OF OCEANIC AND ATMOSPHERIC RESEARCH; PACIFIC MARINE
  ENVIRONMENTAL LABORATORY as part of the Mooring Heron_Island_152E_23S data set.
  CDIAC assigned the following cruise ID(s) to this data set: Heron_Island_152E_23S.\",\n\t\"owner_org\":
